        [HttpGet]
        public AjaxRspJson GetObj(string Language, string obj_code)
        {
            try
            {
                GetObj getObj = _objectCreate.GetObj(obj_code, Language);
                return new AjaxRspJson { RspCode = RspStatus.Successed, ObjectData = getObj, RspMsg = "" };
            }
            catch (Exception ex)
            {
                return new AjaxRspJson { RspCode = RspStatus.Failed, ObjectData = null, RspMsg = ex.Message };
            }
        }

